	module.exports = {"pathContext":{"docHtml":"<h1>Code of Conduct</h1>\n<p>We welcome participation from individuals and groups of all backgrounds who want to benefit the broader open source community\nthrough participation in this project. We are dedicated to ensuring a productive, safe and educational experience for all.</p>\n<h1>Guidelines</h1>\n<p>Be welcoming</p>\n<ul>\n<li>Make it easy for new members to learn and contribute. Help them along the path. Don't make them jump through hoops.</li>\n</ul>\n<p>Be considerate</p>\n<ul>\n<li>There is a live person at the other end of the Internet. Consider how your comments will affect them. It is often better to give a quick but useful reply than to delay to compose a more thorough reply.</li>\n</ul>\n<p>Be respectful</p>\n<ul>\n<li>Not everyone is Linus Torvalds, and this is probably a good thing :) but everyone is deserving of respect and consideration for wanting to benefit the broader community. Criticize ideas but respect the person. Saying something positive before you criticize lets the other person know that your criticism is not personal.</li>\n</ul>\n<p>Be patient</p>\n<ul>\n<li>We have diverse backgrounds. It will take time and effort to understand each others' points of view. Some of us have day jobs and other responsibilities and may take time to respond to requests.</li>\n</ul>\n<h1>Relevant References</h1>\n<ul>\n<li><a href=\"https://www.djangoproject.com/conduct/\">https://www.djangoproject.com/conduct/</a></li>\n<li><a href=\"http://contributor-covenant.org/version/1/4/code_of_conduct.md\">http://contributor-covenant.org/version/1/4/code<em>of</em>conduct.md</a></li>\n<li><a href=\"http://contributor-covenant.org/\">http://contributor-covenant.org/</a></li>\n</ul>","docPath":"argo/code_of_conduct","proj":"argo"}}

