	module.exports = {"pathContext":{"docHtml":"<h1>Roadmap</h1>\n<h2>v2.3</h2>\n<ul>\n<li>Priority - ability to set a priority per workflow</li>\n<li>Queuing - ability to limit number of concurrent workflows</li>\n<li>PNS (Proccess Namespace Sharing) Executor</li>\n</ul>\n<h2>v2.4</h2>\n<ul>\n<li>Persistence - support offloading of workflow state into database layer</li>\n<li>Large workflow support (enabled by persistence feature)</li>\n<li>Argo API server (integration with argo events, persistence layer)</li>\n</ul>\n<h2>v2.5</h2>\n<ul>\n<li>Argo API server enhancements (pagination, SSO, etc...)</li>\n</ul>\n<h3>Proposed Items</h3>\n<ul>\n<li>Best effort workflow steps</li>\n<li>Template level finalizers</li>\n<li>Artifact loop aggregation</li>\n<li>Pod reclamation controls</li>\n</ul>","docPath":"argo/roadmap","proj":"argo"}}

