	module.exports = {"pathContext":{"docHtml":"<h1>Changelog</h1>\n<h2>v0.9</h2>\n<ul>\n<li>Support applying parameters for complete trigger spec #230</li>\n<li>Increased test coverage #220</li>\n<li>Gateway and Sensor pods are managed by the framework in the event of deletion #194</li>\n<li>Add URL to webhook like gateways #216</li>\n<li>Improved file gateway with path regex support #213</li>\n<li>TLS support for webhook #206</li>\n<li>Bug fix for Github gateway #243</li>\n</ul>\n<h2>v0.8</h2>\n<ul>\n<li>Support for arbitrary boolean logic to resolve event dependencies #12</li>\n<li>Ability to add timezone and extra user payload to calendar gateway #164</li>\n<li>Data filter bug fix #165</li>\n<li>Added multi-fields/multi-values data filter #167</li>\n<li>Added support for backoff option when making connections in stream gateway #168</li>\n<li>AWS SNS Gateway #169</li>\n<li>GCP PubSub Gateway #176</li>\n<li>Support for git as trigger source #171</li>\n<li>Enhance Gitlab &#x26; Github gateway with in-build http server #172</li>\n</ul>\n<h2>v0.7</h2>\n<ul>\n<li>Refactor gateways #147</li>\n<li>Fixed sensor error state recovery bug #145</li>\n<li>Ability to add annotations on sensor and gateway pods #143</li>\n<li>Github gateway</li>\n<li>Added support for NATS standard and streaming as communication protocol between gateway\nand sensor #99</li>\n</ul>\n<h2>v0.6</h2>\n<ul>\n<li>Gitlab Gateway #120</li>\n<li>If sensor is repeatable then deploy it as deployment else job #109</li>\n<li>Start gateway containers in correct order. Gateway transformer > gateway processor. Add readiness probe to gateway transformer #106</li>\n<li>Kubernetes configmaps as artifact locations for triggers #104</li>\n<li>Let user set extra environment variable for sensor pod #103 </li>\n<li>Ability to provide complete Pod spec in gateway.</li>\n<li>The schedule for calendar gateway is now in standard cron format   #102</li>\n<li>FileWatcher as core gateway #98</li>\n<li>Tutorials on setting up pipelines #105</li>\n<li>Asciinema recording for setup #107</li>\n<li>StorageGrid Gateway</li>\n<li>Scripts to generate swagger specs from gateway structs</li>\n<li>Added support to pass non JSON payload to trigger</li>\n<li>Update shopify's sarama to 1.19.0 to support Kafka 2.0</li>\n</ul>\n<h2>v0.5</h2>\n<p><a href=\"https://github.com/argoproj/argo-events/pull/92\">#92</a></p>\n<ul>\n<li>Introduced gateways as event generators. </li>\n<li>Added multiple flavors of gateway - core gateways, gRPC gateways, HTTP gateways, custom gateways</li>\n<li>Added K8 events to capture gateway configurations update and as means to update gateway resource</li>\n<li>SLA violations are now reported through k8 events</li>\n<li>Sensors can trigger Argo workflow, any kubernetes resource and gateway</li>\n<li>Gateway can send events to other gateways and sensors</li>\n<li>Added examples for gateway and sensors</li>\n<li>Sensors are now repeatable and fixed all issues with signal repeatability.</li>\n<li>Removed signal deployments as microservices.</li>\n</ul>\n<h2>v0.5-beta1 (tbd)</h2>\n<ul>\n<li>Signals as separate deployments <a href=\"https://github.com/argoproj/argo-events/pull/49\">#49</a></li>\n<li>Fixed code-gen bug <a href=\"https://github.com/argoproj/argo-events/issues/46\">#46</a></li>\n<li>Filters for signals <a href=\"https://github.com/argoproj/argo-events/issues/26\">#26</a></li>\n<li>Inline, file and url sources for trigger workflows <a href=\"https://github.com/argoproj/argo-events/issues/41\">#41</a></li>\n</ul>\n<h2>v0.5-alpha1</h2>\n<ul>\n<li>Initial release</li>\n</ul>","docPath":"argo-events/changelog","proj":"argo-events"}}

