	module.exports = {"pathContext":{"docHtml":"<h1>Argo Community</h1>\n<p>Welcome to the Argo community!</p>\n<p>Argo is an open, community driven project to make it easy to use Kubernetes for getting useful work done.  This document describes the organizational structure of the Argo Community including the roles, responsibilities and processes that govern Argo projects and community.</p>\n<p>Community meeting notes is available <a href=\"https://docs.google.com/document/d/16aWGQ1Te5IRptFuAIFtg3rONRQqHC1Z3X9rdDHYhYfE/edit?usp=sharing\">here</a>.</p>\n<h2>Projects</h2>\n<p>Argo is organized into a set of projects. Each project has at least one owner. The owner is responsible for publishing a roadmap and organizing community meetings for soliciting feedback, publishing meeting notes, and reporting on the current status of the project.</p>\n<p>The projects are:</p>\n<ul>\n<li>Argo Workflows</li>\n<li>Argo CD</li>\n<li>Argo Events</li>\n<li>Argo CI</li>\n</ul>\n<h2>Community Roles and Responsibilities</h2>\n<table>\n<thead>\n<tr>\n<th>Roles</th>\n<th align=\"center\">Responsibilities</th>\n<th align=\"right\">Requirements</th>\n<th align=\"right\">Recognized by</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>Member</td>\n<td align=\"center\">Active contributor</td>\n<td align=\"right\">Active contributor, sponsored by reviewers</td>\n<td align=\"right\">Argo GitHub org member</td>\n</tr>\n<tr>\n<td>Reviewer</td>\n<td align=\"center\">Review PRs and proposals</td>\n<td align=\"right\">History of review and authorship</td>\n<td align=\"right\">OWNERS file reviewer entry</td>\n</tr>\n<tr>\n<td>Approver</td>\n<td align=\"center\">Approve and accept PRs</td>\n<td align=\"right\">Highly experienced, active reviewer and contributor</td>\n<td align=\"right\">OWNERS file approver entry</td>\n</tr>\n<tr>\n<td>Owner</td>\n<td align=\"center\">Set priorities, approve proposals</td>\n<td align=\"right\">Demonstrated responsibility and good judgement</td>\n<td align=\"right\">Member of Argo TOC</td>\n</tr>\n</tbody>\n</table>\n<ul>\n<li>Members may also review PRs and proposals.</li>\n<li>Reviewers have a responsibility to regularly review PRs and proposals in a timely\nmanner.</li>\n<li>Approvers may commit changes.</li>\n<li>Owners provide technical leadership and are responsible for making project-level decisions in consultation with other members.</li>\n</ul>\n<h2>Contributing to Argo</h2>\n<p>Read and abide by the <a href=\"https://github.com/argoproj/argo/blob/master/CODE_OF_CONDUCT.md\">Argo Code of Conduct</a> :\nBefore submitting a pull request, please sign the <a href=\"https://github.com/argoproj/argo/blob/master/community/Argo%20Individual%20CLA.pdf\">CLA</a>. This agreement gives us permission to use and redistribute your contributions as part of the project.</p>\n<h2>Community Meetings</h2>\n<p>Approvers and owners for each project are responsible for organizing regular community meetings to provide status updates and solicit feedback.</p>\n<ul>\n<li>Meeting agendas should be published at least one week prior to the meeting.</li>\n<li>Community members should be able to attend the meetings remotely.</li>\n<li>Meeting notes summarizing the meeting and any decisions made should be published\nwithin 24 hours of the meeting.</li>\n<li>Meeting recordings should be published within one week of the meeting.</li>\n</ul>\n<h2>Technical Oversight Committee</h2>\n<p>The Argo Technical Oversight Committee (TOC) is responsible for cross-cutting product and design decisions. The membership of the TOC consists of owners of the Argo projects and technical representatives from the steering committee.</p>\n<h2>Steering Committee</h2>\n<p>The Argo Steering Committee provides high-level guidance regarding the overall direction of the project and relative priority of use cases. Committee members are selected to represent the interests of the major users and contributors of the Argo Project.\nAs custodian of the Argo project, Intuit will be responsible for the overall administration of  the argoproj organization on GitHub.</p>","docPath":"argo/community/readme","proj":"argo"}}

