	module.exports = {"pathContext":{"docHtml":"<h1>Workflow Variables</h1>\n<p>The following variables are made available to reference various metadata of a workflow:</p>\n<h2>All Templates:</h2>\n<table>\n<thead>\n<tr>\n<th>Variable</th>\n<th>Description</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td><code>inputs.parameters.&#x3C;NAME></code></td>\n<td>Input parameter to a template</td>\n</tr>\n<tr>\n<td><code>inputs.artifacts.&#x3C;NAME></code></td>\n<td>Input artifact to a template</td>\n</tr>\n</tbody>\n</table>\n<h2>Steps Templates:</h2>\n<table>\n<thead>\n<tr>\n<th>Variable</th>\n<th>Description</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td><code>steps.&#x3C;STEPNAME>.ip</code></td>\n<td>IP address of a previous daemon container step</td>\n</tr>\n<tr>\n<td><code>steps.&#x3C;STEPNAME>.outputs.result</code></td>\n<td>Output result of a previous script step</td>\n</tr>\n<tr>\n<td><code>steps.&#x3C;STEPNAME>.outputs.parameters.&#x3C;NAME></code></td>\n<td>Output parameter of a previous step</td>\n</tr>\n<tr>\n<td><code>steps.&#x3C;STEPNAME>.outputs.artifacts.&#x3C;NAME></code></td>\n<td>Output artifact of a previous step</td>\n</tr>\n</tbody>\n</table>\n<h2>DAG Templates:</h2>\n<table>\n<thead>\n<tr>\n<th>Variable</th>\n<th>Description</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td><code>tasks.&#x3C;TASKNAME>.ip</code></td>\n<td>IP address of a previous daemon container task</td>\n</tr>\n<tr>\n<td><code>tasks.&#x3C;TASKNAME>.outputs.result</code></td>\n<td>Output result of a previous script task</td>\n</tr>\n<tr>\n<td><code>tasks.&#x3C;TASKNAME>.outputs.parameters.&#x3C;NAME></code></td>\n<td>Output parameter of a previous task</td>\n</tr>\n<tr>\n<td><code>tasks.&#x3C;TASKNAME>.outputs.artifacts.&#x3C;NAME></code></td>\n<td>Output artifact of a previous task</td>\n</tr>\n</tbody>\n</table>\n<h2>Container/Script Templates:</h2>\n<table>\n<thead>\n<tr>\n<th>Variable</th>\n<th>Description</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td><code>pod.name</code></td>\n<td>Pod name of the container/script</td>\n</tr>\n<tr>\n<td><code>inputs.artifacts.&#x3C;NAME>.path</code></td>\n<td>Local path of the input artifact</td>\n</tr>\n<tr>\n<td><code>outputs.artifacts.&#x3C;NAME>.path</code></td>\n<td>Local path of the output artifact</td>\n</tr>\n<tr>\n<td><code>outputs.parameters.&#x3C;NAME>.path</code></td>\n<td>Local path of the output parameter</td>\n</tr>\n</tbody>\n</table>\n<h2>Loops (withItems / withParam)</h2>\n<table>\n<thead>\n<tr>\n<th>Variable</th>\n<th>Description</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td><code>item</code></td>\n<td>Value of the item in a list</td>\n</tr>\n<tr>\n<td><code>item.&#x3C;FIELDNAME></code></td>\n<td>Field value of the item in a list of maps</td>\n</tr>\n</tbody>\n</table>\n<h2>Global:</h2>\n<table>\n<thead>\n<tr>\n<th>Variable</th>\n<th>Description</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td><code>workflow.name</code></td>\n<td>Workflow name</td>\n</tr>\n<tr>\n<td><code>workflow.namespace</code></td>\n<td>Workflow namespace</td>\n</tr>\n<tr>\n<td><code>workflow.uid</code></td>\n<td>Workflow UID. Useful for setting ownership reference to a resource, or a unique artifact location</td>\n</tr>\n<tr>\n<td><code>workflow.parameters.&#x3C;NAME></code></td>\n<td>Input parameter to the workflow</td>\n</tr>\n<tr>\n<td><code>workflow.outputs.parameters.&#x3C;NAME></code></td>\n<td>Input artifact to the workflow</td>\n</tr>\n<tr>\n<td><code>workflow.annotations.&#x3C;NAME></code></td>\n<td>Workflow annotations</td>\n</tr>\n<tr>\n<td><code>workflow.labels.&#x3C;NAME></code></td>\n<td>Workflow labels</td>\n</tr>\n<tr>\n<td><code>workflow.creationTimestamp</code></td>\n<td>Workflow creation timestamp formatted in RFC 3339  (e.g. \n<code>2018-08-23T05:42:49Z</code>\n)</td>\n</tr>\n<tr>\n<td><code>workflow.creationTimestamp.&#x3C;STRFTIMECHAR></code></td>\n<td>Creation timestamp formatted with a \n<a href=\"http://strftime.org\">strftime</a>\n format character</td>\n</tr>\n</tbody>\n</table>\n<h2>Exit Handler:</h2>\n<table>\n<thead>\n<tr>\n<th>Variable</th>\n<th>Description</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td><code>workflow.status</code></td>\n<td>Workflow status. One of: \n<code>Succeeded</code>\n, \n<code>Failed</code>\n, \n<code>Error</code></td>\n</tr>\n</tbody>\n</table>","docPath":"argo/docs/variables","proj":"argo"}}

