	module.exports = {"pathContext":{"docHtml":"<h1>Overview</h1>\n<h2>What Is Argo CD?</h2>\n<p>Argo CD is a declarative, GitOps continuous delivery tool for Kubernetes.</p>\n<p><img src=\"/argo-cd/docs/assets/argocd-ui.gif\" alt=\"Argo CD UI\"></p>\n<h2>Why Argo CD?</h2>\n<p>Application definitions, configurations, and environments should be declarative and version controlled.\nApplication deployment and lifecycle management should be automated, auditable, and easy to understand.</p>\n<h2>Getting Started</h2>\n<h3>Quick Start</h3>\n<pre><code class=\"language-bash\">kubectl create namespace argocd\nkubectl apply -n argocd -f https://raw.githubusercontent.com/argoproj/argo-cd/stable/manifests/install.yaml\n</code></pre>\n<p>Follow our <a href=\"getting_started.html\">getting started guide</a>. Further <a href=\"docs/\">documentation</a>\nis provided for additional features.</p>\n<h2>How it works</h2>\n<p>Argo CD follows the <strong>GitOps</strong> pattern of using Git repositories as the source of truth for defining\nthe desired application state. Kubernetes manifests can be specified in several ways:</p>\n<ul>\n<li><a href=\"https://kustomize.io\">kustomize</a> applications</li>\n<li><a href=\"https://helm.sh\">helm</a> charts</li>\n<li><a href=\"https://ksonnet.io\">ksonnet</a> applications</li>\n<li><a href=\"https://jsonnet.org\">jsonnet</a> files </li>\n<li>Plain directory of YAML/json manifests</li>\n<li>Any custom config management tool configured as a config management plugin</li>\n</ul>\n<p>Argo CD automates the deployment of the desired application states in the specified target environments.\nApplication deployments can track updates to branches, tags, or pinned to a specific version of\nmanifests at a Git commit. See <a href=\"user-guide/tracking_strategies.html\">tracking strategies</a> for additional\ndetails about the different tracking strategies available.</p>\n<p>For a quick 10 minute overview of Argo CD, check out the demo presented to the Sig Apps community\nmeeting:\n<a href=\"https://youtu.be/aWDIQMbp1cc?t=1m4s\"><img src=\"https://img.youtube.com/vi/aWDIQMbp1cc/0.jpg\" alt=\"Alt text\"></a></p>\n<h2>Architecture</h2>\n<p>\n  <a\n    class=\"gatsby-resp-image-link\"\n    href=\"/static/argocd_architecture-643caa8250f7d6d582497dca23c685f2-d0cc3.png\"\n    style=\"display: block\"\n    target=\"_blank\"\n    rel=\"noopener\"\n  >\n  \n  <span\n    class=\"gatsby-resp-image-wrapper\"\n    style=\"position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;\"\n  >\n    <span\n      class=\"gatsby-resp-image-background-image\"\n      style=\"padding-bottom: 95.28936742934052%; position: relative; bottom: 0; left: 0; background-image: url('data:image/png;base64,'); background-size: cover; display: block;\"\n    >\n      <img\n        class=\"gatsby-resp-image-image\"\n        style=\"width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;\"\n        alt=\"Argo CD Architecture\"\n        title=\"\"\n        src=\"/static/argocd_architecture-643caa8250f7d6d582497dca23c685f2-fb8a0.png\"\n        srcset=\"/static/argocd_architecture-643caa8250f7d6d582497dca23c685f2-1a291.png 148w,\n/static/argocd_architecture-643caa8250f7d6d582497dca23c685f2-2bc4a.png 295w,\n/static/argocd_architecture-643caa8250f7d6d582497dca23c685f2-fb8a0.png 590w,\n/static/argocd_architecture-643caa8250f7d6d582497dca23c685f2-d0cc3.png 743w\"\n        sizes=\"(max-width: 590px) 100vw, 590px\"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Argo CD is implemented as a kubernetes controller which continuously monitors running applications\nand compares the current, live state against the desired target state (as specified in the Git repo).\nA deployed application whose live state deviates from the target state is considered <code>OutOfSync</code>.\nArgo CD reports &#x26; visualizes the differences, while providing facilities to automatically or\nmanually sync the live state back to the desired target state. Any modifications made to the desired\ntarget state in the Git repo can be automatically applied and reflected in the specified target\nenvironments.</p>\n<p>For additional details, see <a href=\"operator-manual/architecture.html\">architecture overview</a>.</p>\n<h2>Features</h2>\n<ul>\n<li>Automated deployment of applications to specified target environments</li>\n<li>Support for multiple config management/templating tools (Kustomize, Helm, Ksonnet, Jsonnet, plain-YAML)</li>\n<li>Ability to manage and deploy to multiple clusters</li>\n<li>SSO Integration (OIDC, OAuth2, LDAP, SAML 2.0, GitHub, GitLab, Microsoft, LinkedIn)</li>\n<li>Multi-tenancy and RBAC policies for authorization</li>\n<li>Rollback/Roll-anywhere to any application configuration committed in Git repository</li>\n<li>Health status analysis of application resources</li>\n<li>Automated configuration drift detection and visualization</li>\n<li>Automated or manual syncing of applications to its desired state</li>\n<li>Web UI which provides real-time view of application activity</li>\n<li>CLI for automation and CI integration</li>\n<li>Webhook integration (GitHub, BitBucket, GitLab)</li>\n<li>Access tokens for automation</li>\n<li>PreSync, Sync, PostSync hooks to support complex application rollouts (e.g.blue/green &#x26; canary upgrades)</li>\n<li>Audit trails for application events and API calls</li>\n<li>Prometheus metrics</li>\n<li>Parameter overrides for overriding ksonnet/helm parameters in Git</li>\n</ul>\n<h2>Community Blogs And Presentations</h2>\n<ul>\n<li>GitOps with Argo CD: <a href=\"https://www.ibm.com/blogs/bluemix/2019/02/simplify-and-automate-deployments-using-gitops-with-ibm-multicloud-manager-3-1-2/\">Simplify and Automate Deployments Using GitOps with IBM Multicloud Manager</a></li>\n<li>KubeCon talk: <a href=\"https://www.youtube.com/watch?v=OdzH82VpMwI&#x26;feature=youtu.be\">CI/CD in Light Speed with K8s and Argo CD</a></li>\n<li>\n<p>KubeCon talk: <a href=\"https://www.youtube.com/watch?v=VXrGp5er1ZE&#x26;t=0s&#x26;index=135&#x26;list=PLj6h78yzYM2PZf9eA7bhWnIh_mK1vyOfU\">Machine Learning as Code</a></p>\n<ul>\n<li>Among other things, describes how Kubeflow uses Argo CD to implement GitOPs for ML</li>\n</ul>\n</li>\n<li>SIG Apps demo: <a href=\"https://www.youtube.com/watch?v=aWDIQMbp1cc&#x26;feature=youtu.be&#x26;t=1m4s\">Argo CD - GitOps Continuous Delivery for Kubernetes</a></li>\n</ul>\n<h2>Development Status</h2>\n<p>Argo CD is actively developed and is being used in production to deploy SaaS services at Intuit</p>","docPath":"argo-cd/docs/index","proj":"argo-cd"}}

