	module.exports = {"pathContext":{"docHtml":"<h2>Controllers</h2>\n<ul>\n<li>Sensor and Gateway controllers are the components which manage Sensor and Gateway resources. </li>\n<li>Sensor and Gateway are Kubernetes Custom Resources. For more information on K8 CRDs visit, <a href=\"https://kubernetes.io/docs/concepts/extend-kubernetes/api-extension/custom-resources/\">https://kubernetes.io/docs/concepts/extend-kubernetes/api-extension/custom-resources/</a></li>\n</ul>\n<h3>Controller configmap</h3>\n<p>Defines the <code>instance-id</code> and the <code>namespace</code> for controller configmap\ne.g. </p>\n<pre><code class=\"language-yaml\"># The gateway-controller configmap includes configuration information for the gateway-controller\napiVersion: v1\nkind: ConfigMap\nmetadata:\n  name: gateway-controller-configmap\ndata:\n  config: |\n    instanceID: argo-events  # mandatory\n    namespace: my-custom-namespace # optional\n</code></pre>\n<p><b><code>namespace</code></b>: If you don't provide namespace, controller will watch all namespaces for gateway resource.</p>\n<p><b><code>instance-id</code></b>: it is used to map a gateway or sensor to a controller.\ne.g. when you create a gateway with label <code>gateways.argoproj.io/gateway-controller-instanceid: argo-events</code>, a\ncontroller with label <code>argo-events</code> will process that gateway. <code>instance-id</code> for controller are managed using <a href=\"https://raw.githubusercontent.com/argoproj/argo-events/master/hack/k8s/manifests/gateway-controller-configmap.yaml\">controller-configmap</a>.\nBasically <code>instance-id</code> is used to horizontally scale controllers, so you won't end up overwhelming a controller with large\nnumber of gateways or sensors. Also keep in mind that <code>instance-id</code> has nothing to do with namespace where you are\ndeploying controllers and gateways/sensors.</p>\n<h3>Gateway controller</h3>\n<p>Gateway controller watches gateway resource and manages lifecycle of a gateway.</p>\n<h3>Sensor controller</h3>\n<p>Sensor controller watches sensor resource and manages lifecycle of a sensor.</p>","docPath":"argo-events/docs/controllers-guide","proj":"argo-events"}}

