	module.exports = {"pathContext":{"docHtml":"<h1>Overview</h1>\n<p>This guide is for developers who have Argo CD installed for them and are managing applications.</p>\n<p>!!! note\nPlease make sure you've completed the <a href=\"../getting_started.html\">getting started guide</a>. </p>","docPath":"argo-cd/docs/user-guide/index","proj":"argo-cd"}}

