	module.exports = {"pathContext":{"docHtml":"<h1>Resource Health</h1>\n<h2>Overview</h2>\n<p>Argo CD provides built-in health assessment for several standard Kubernetes types, which is then\nsurfaced to the overall Application health status as a whole. The following checks are made for\nspecific types of kuberentes resources:</p>\n<h3>Deployment, ReplicaSet, StatefulSet DaemonSet</h3>\n<ul>\n<li>Observed generation is equal to desired generation.</li>\n<li>Number of <strong>updated</strong> replicas equals the number of desired replicas.</li>\n</ul>\n<h3>Service</h3>\n<ul>\n<li>If service type is of type <code>LoadBalancer</code>, the <code>status.loadBalancer.ingress</code> list is non-empty,\nwith at least one value for <code>hostname</code> or <code>IP</code>.</li>\n</ul>\n<h3>Ingress</h3>\n<ul>\n<li>The <code>status.loadBalancer.ingress</code> list is non-empty, with at least one value for <code>hostname</code> or <code>IP</code>.</li>\n</ul>\n<h3>PersistentVolumeClaim</h3>\n<ul>\n<li>The <code>status.phase</code> is <code>Bound</code></li>\n</ul>\n<h2>Custom Health Checks</h2>\n<p>Argo CD supports custom health checks written in <a href=\"https://www.lua.org/\">Lua</a>. This is useful if you:</p>\n<ul>\n<li>Are affected by known issues where your <code>Ingress</code> or <code>StatefulSet</code> resources are stuck in <code>Progressing</code> state because of bug in your resource controller.</li>\n<li>Have a custom resource for which Argo CD does not have a built-in health check.</li>\n</ul>\n<p>There are two ways to configure a custom health check. The next two sections describe those ways.</p>\n<h3>Way 1. Define a Custom Health Check in <code>argocd-cm</code> ConfigMap</h3>\n<p>Custom health checks can be defined in <code>resource.customizations</code> field of <code>argocd-cm</code>. Following example demonstrates a health check for <code>certmanager.k8s.io/Certificate</code>.</p>\n<pre><code class=\"language-yaml\">data:\n  resource.customizations: |\n    certmanager.k8s.io/Certificate:\n      health.lua: |\n        hs = {}\n        if obj.status ~= nil then\n          if obj.status.conditions ~= nil then\n            for i, condition in ipairs(obj.status.conditions) do\n              if condition.type == \"Ready\" and condition.status == \"False\" then\n                hs.status = \"Degraded\"\n                hs.message = condition.message\n                return hs\n              end\n              if condition.type == \"Ready\" and condition.status == \"True\" then\n                hs.status = \"Healthy\"\n                hs.message = condition.message\n                return hs\n              end\n            end\n          end\n        end\n        \n        hs.status = \"Progressing\"\n        hs.message = \"Waiting for certificate\"\n        return hs\n</code></pre>\n<p>The <code>obj</code> is a global variable which contains the resource. The script must return an object with status and optional message field.</p>\n<p>NOTE: as a security measure you don't have access to most of the standard Lua libraries.</p>\n<h3>Way 2. Contribute a Custom Health Check</h3>\n<p>A health check can be bundled into Argo CD. Custom health check scripts are located in the <code>resource_customizations</code> directory of <a href=\"https://github.com/argoproj/argo-cd\">https://github.com/argoproj/argo-cd</a>. This must have the following directory structure:</p>\n<pre><code>argo-cd\n|-- resource_customizations\n|    |-- your.crd.group.io               # CRD group\n|    |    |-- MyKind                     # Resource kind\n|    |    |    |-- health.lua            # Health check\n|    |    |    |-- health_test.yaml      # Test inputs and expected results\n|    |    |    +-- testdata              # Directory with test resource YAML definitions\n</code></pre>\n<p>Each health check must have tests defined in <code>health_test.yaml</code> file. The <code>health_test.yaml</code> is a YAML file with the following structure:</p>\n<pre><code class=\"language-yaml\">tests:\n- healthStatus:\n    status: ExpectedStatus\n    message: Expected message\n  inputPath: testdata/test-resource-definition.yaml\n</code></pre>\n<p>The <a href=\"https://github.com/argoproj/argo-cd/pull/1139\">PR#1139</a> is an example of Cert Manager CRDs custom health check.</p>","docPath":"argo-cd/docs/operator-manual/health","proj":"argo-cd"}}

