	module.exports = {"pathContext":{"docHtml":"<h1>Overview</h1>\n<p>This guide is for administrator and operator wanting to install and configure Argo CD for other developers.</p>\n<p>!!! note\nPlease make sure you've completed the <a href=\"../getting_started.html\">getting started guide</a>.</p>","docPath":"argo-cd/docs/operator-manual/index","proj":"argo-cd"}}

