	module.exports = {"pathContext":{"docHtml":"<h1>Metrics</h1>\n<p>Argo CD exposes two sets of Prometheus metrics</p>\n<h2>Application Metrics</h2>\n<p>Metrics about applications. Scraped at the <code>argocd-metrics:8082/metrics</code> endpoint. </p>\n<ul>\n<li>Gauge for application health status</li>\n<li>Gauge for application sync status</li>\n<li>Counter for application sync history</li>\n</ul>\n<h2>API Server Metrics</h2>\n<p>Metrics about API Server API request and response activity (request totals, response codes, etc...).\nScraped at the <code>argocd-server-metrics:8083/metrics</code> endpoint.</p>\n<h2>Prometheus Operator</h2>\n<p>If using Prometheus Operator, the following ServiceMonitor example manifests can be used.\nChange <code>metadata.labels.release</code> to the name of label selected by your Prometheus.</p>\n<pre><code class=\"language-yaml\">apiVersion: monitoring.coreos.com/v1\nkind: ServiceMonitor\nmetadata:\n  name: argocd-metrics\n  labels:\n    release: prometheus-operator\nspec:\n  selector:\n    matchLabels:\n      app.kubernetes.io/name: argocd-metrics\n  endpoints:\n  - port: metrics\n</code></pre>\n<pre><code class=\"language-yaml\">apiVersion: monitoring.coreos.com/v1\nkind: ServiceMonitor\nmetadata:\n  name: argocd-server-metrics\n  labels:\n    release: prometheus-operator\nspec:\n  selector:\n    matchLabels:\n      app.kubernetes.io/name: argocd-server-metrics\n  endpoints:\n  - port: metrics\n</code></pre>\n<pre><code class=\"language-yaml\">apiVersion: monitoring.coreos.com/v1\nkind: ServiceMonitor\nmetadata:\n  name: argocd-repo-server-metrics\n  labels:\n    release: prometheus-operator\nspec:\n  selector:\n    matchLabels:\n      app.kubernetes.io/name: argocd-repo-server\n  endpoints:\n  - port: metrics\n</code></pre>\n<h2>Dashboards</h2>\n<p>You can find an example Grafana dashboard <a href=\"../../examples/dashboard.json\">here</a></p>\n<p>\n  <a\n    class=\"gatsby-resp-image-link\"\n    href=\"/static/dashboard-9e3cbbf112c21fce10e36cf9294584d2-ba94a.jpg\"\n    style=\"display: block\"\n    target=\"_blank\"\n    rel=\"noopener\"\n  >\n  \n  <span\n    class=\"gatsby-resp-image-wrapper\"\n    style=\"position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;\"\n  >\n    <span\n      class=\"gatsby-resp-image-background-image\"\n      style=\"padding-bottom: 67.32081911262799%; position: relative; bottom: 0; left: 0; background-image: url('data:image/png;base64,'); background-size: cover; display: block;\"\n    >\n      <img\n        class=\"gatsby-resp-image-image\"\n        style=\"width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;\"\n        alt=\"dashboard\"\n        title=\"\"\n        src=\"/static/dashboard-9e3cbbf112c21fce10e36cf9294584d2-f8fb9.jpg\"\n        srcset=\"/static/dashboard-9e3cbbf112c21fce10e36cf9294584d2-e8976.jpg 148w,\n/static/dashboard-9e3cbbf112c21fce10e36cf9294584d2-63df2.jpg 295w,\n/static/dashboard-9e3cbbf112c21fce10e36cf9294584d2-f8fb9.jpg 590w,\n/static/dashboard-9e3cbbf112c21fce10e36cf9294584d2-85e3d.jpg 885w,\n/static/dashboard-9e3cbbf112c21fce10e36cf9294584d2-d1924.jpg 1180w,\n/static/dashboard-9e3cbbf112c21fce10e36cf9294584d2-9452e.jpg 1770w,\n/static/dashboard-9e3cbbf112c21fce10e36cf9294584d2-ba94a.jpg 2344w\"\n        sizes=\"(max-width: 590px) 100vw, 590px\"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>","docPath":"argo-cd/docs/operator-manual/metrics","proj":"argo-cd"}}

