	module.exports = {"pathContext":{"docHtml":"<h1>Site</h1>\n<h2>Developing And Testing</h2>\n<p>The web site is build using <code>mkdocs</code> and <code>mkdocs-material</code>. </p>\n<p>To test:</p>\n<pre><code class=\"language-bash\">mkdocs serve\n</code></pre>\n<h2>Deploying</h2>\n<pre><code class=\"language-bash\">mkdocs gh-deploy\n</code></pre>\n<h2>Analytics</h2>\n<p>!!! tip\nDon't forget to disable your ad-blocker when testing.</p>\n<p>We collect <a href=\"https://analytics.google.com/analytics/web/#/report-home/a105170809w198079555p192782995\">Google Analytics</a>.</p>","docPath":"argo-cd/docs/developer-guide/site","proj":"argo-cd"}}

