	module.exports = {"pathContext":{"docHtml":"<p align=\"center\">\n  <img src=\"https://github.com/argoproj/argo-events/blob/update-docs/docs/assets/stream.png?raw=true\" alt=\"Stream\">\n</p>\n<br/>\n<h1>Streams</h1>\n<p>A Stream Gateway basically listens to messages on a message queue.</p>\n<p>The configuration for an event source is somewhat similar between all stream gateways. We will go through setup of NATS gateway.</p>\n<h2>NATS</h2>\n<p>NATS gateway consumes messages by subscribing to NATS topic.</p>\n<h3>How to define an event source in confimap?</h3>\n<p>An entry in the gateway configmap corresponds to <a href=\"https://github.com/argoproj/argo-events/blob/39fd5b8592e27c869dcc6cf2b0e6fee1d56622f2/gateways/core/stream/nats/config.go#L33-L40\">this</a>.</p>\n<p>If you don't provide an explicit <code>Backoff</code>, then gateway will use a default backoff in case of connection failure.</p>\n<p>The <a href=\"../../../examples/gateways/nats-gateway-configmap.yaml\">event source</a> contains information to subscribe to topic <code>foo</code>, it also contains an explicit backoff option\nin case of the connection failure.</p>\n<h3>Setup</h3>\n<p><strong>1. Install <a href=\"../../../examples/gateways/nats-gateway-configmap.yaml\">Gateway Configmap</a></strong></p>\n<p><strong>2. Install <a href=\"../../../examples/gateways/nats.yaml\">Gateway</a></strong></p>\n<p>Make sure the gateway pod is created.</p>\n<p><strong>3. Install <a href=\"../../../examples/sensors/nats.yaml\">Sensor</a></strong></p>\n<p>Make sure the sensor pod is created</p>\n<p><strong>4. Trigger Workflow</strong></p>\n<p>Publish message to subject <code>foo</code>.\nYou might find this useful <a href=\"https://github.com/nats-io/go-nats/tree/master/examples/nats-pub\">https://github.com/nats-io/go-nats/tree/master/examples/nats-pub</a></p>\n<h2>Setting up other stream gateways</h2>\n<p>You can follow examples <a href=\"../../../examples/gateways\">here</a> to setup other stream gateways.</p>","docPath":"argo-events/gateways/core/stream/readme","proj":"argo-events"}}

