	module.exports = {"pathContext":{"docHtml":"<p align=\"center\">\n  <img src=\"https://github.com/argoproj/argo-events/blob/ebdbdd4a2a8ce47a0fc6e9a6a63531be2c26148a/docs/assets/pubsub.png?raw=true\" alt=\"GCP PubSub\">\n</p>\n<br/>\n<h1>GCP PubSub</h1>\n<p>GCP PubSub gateway listens to event streams on google cloud pub sub topics.</p>\n<h3>How to define an event source in confimap?</h3>\n<p>An entry in the gateway configmap corresponds to <a href=\"https://github.com/argoproj/argo-events/blob/a913dafbf000eb05401ef2c847b29152af82977f/gateways/community/gcp-pubsub/config.go#L31-L36\">this</a>.</p>\n<p>Make sure to mount credentials file for authentication in gateway pod and refer the path in <code>credentialsFile</code>.</p>\n<h2>Setup</h2>\n<p><strong>1. Install <a href=\"../../../examples/gateways/gcp-pubsub-gateway-configmap.yaml\">Gateway Configmap</a></strong></p>\n<p><strong>2. Install <a href=\"../../../examples/gateways/gcp-pubsub.yaml\">Gateway</a></strong></p>\n<p>Make sure gateway pod and service is running</p>\n<p><strong>3. Install <a href=\"../../../examples/sensors/gcp-pubsub.yaml\">Sensor</a></strong></p>\n<p>Make sure sensor pod is created.</p>\n<p><strong>4. Trigger Workflow</strong></p>\n<p>As soon as there a message is consumed from PubSub topic, a workflow will be triggered.</p>","docPath":"argo-events/gateways/community/gcp-pubsub/readme","proj":"argo-events"}}

